import React from "react";
import { Link } from "react-router-dom";
import Button from "../components/Button/Button";
import Greeting from "../components/Greeting/Greeting";


export default function Welcome() {
  return (
    <div className="welcome-page">
      <Greeting headline='Tripster' tag='Welcome to' description="Connect and chat with fellow travellers"/>
      <img className="welcome-page__img" src={require('./../graphics/app_logo_big.png')} alt="Tripster Logo" height='200' width ='200'></img>
      <Link to="/signup">
        <Button text="Sign up" type="signup" />
      </Link>
      <Link to="login">
        <Button text="Log in" type="login" />
      </Link>
    </div>
  );
}
